import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./Components/Navbar";
import Home from "./pages/index";

function App() {
  return (
    <>
      <Router>
        <Navbar>
          <Switch>
            <Route path="/" exact component={Home}></Route>
          </Switch>
        </Navbar>
      </Router>
    </>
  );
}

export default App;
